import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import 'bootstrap/dist/css/bootstrap.min.css';
import Home from './Components/Home';
import Header from './Components/Header';
import LoginPage from './Components/Login';
import About from './Components/About';
import Footer from './Components/Footer'; 
import Dashboard from './Components/Dashboard';
// import CategoryPage from "./CategoryPage";
function App() {
  return (

    <Router>
      <Routes>
        <Route path="D:\Remedies\src\Components\Header.js" element={<Header/>} />
        <Route path="D:\Remedies\src\Components\Home.js" element={<Home />} />
        <Route path="D:\Remedies\src\Components\Footer.js" element={<Footer />} />
        <Route path="D:\Remedies\src\Components\Login.js" element={<LoginPage />} />
        <Route path="D:\Remedies\src\Components\About.js" element={<About />} />
        <Route path="D:\Remedies\src\Components\Dashboard.js" element={<Dashboard />} />
        {/* <Route path="/category/:title" element={<CategoryPage />} /> */}
      </Routes>
    </Router>
  );
}

export default App;
